    const signUpEvent = (event) => {
        event.preventDefault();
        fetch('/users', {
            method: POST,
            headers: {
                'Content-Type': 'application/json',
              },
              body: JSON.stringify(formData),
            

        })

    }

    return (
        <div>

            <h1>Sign Up</h1>

            <form>
                <label>
                    Username:
                    <input type="text" signUpName="Username"></input>
                </label>
            </form>
            <form>
                <label>
                    Password:
                    <input type="text" signUpPass="password"></input>
                </label>
            </form>

            <button onClick={()=> setSignup(true)}>Log in</button>

        </div>

    );
};

export default Login
